description:
Fireproof (2008) 

Verenigde Staten
Drama
122 minuten

geregisseerd door Alex Kendrick
met Kirk Cameron, Erin Bethea en Ken Bevel

Brandweerman Caleb Holt (Kirk Cameron) slaagt er altijd weer in om mensen - die hij niet kent - uit brandende gebouwen te redden. Hij is een held voor veel mensen, maar niet voor zijn eigen vrouw Catherine (Erin Bethea). Hun relatie verloopt niet soepel en het komt tot een scheiding. Dan beseft Caleb dat het anders moet en probeert hij het vertrouwen van zijn vrouw terug te winnen...

